import Link from 'next/link';

function Header() {
  return (
    <>
      <nav className="flex justify-between h-16 border items-center">
        <Link href="/">
          <a className="text-red">Logo</a>
        </Link>
        <ul className="flex items-center">
          <Link href="/writing">
            <li className="hover:text-teal-900 mr-6 cursor-pointer">Writing</li>
          </Link>
        </ul>
      </nav>
    </>
  );
}

function NavLink(props) {
  return;
  <Link href="/about">
    <li className="hover:text-teal-900 cursor-pointer">About</li>
  </Link>;
}

export default Header;
